import React,{useState} from 'react';
import '../cssmodule/Nftblock.css';
import Ownednft from './Ownednft';

const Nftblock=(props)=>{
   
    const changevalue=()=>{

        props.changepopup();

        props.popupv({
            img:props.src,
            heading:props.heading,
            para:props.para
        });
    }


return(
    
    <div className='nft' onClick={changevalue}>
        
        <img src={props.src}/>
        <div id='nft-img'></div>
       
        <div class='subblock '>
        
            <h2>{props.heading}</h2>
            <p>{props.para}</p>
            <p>Contract address:{props.address}</p>
            <p>token id{props.token}</p>
        </div>
        
    </div>
    
);

}


export default Nftblock;
